import React from "react";

const Header = () => {
    return (
        <header className="header">
            <img
                className="icon"
                src="https://img.favpng.com/23/18/11/logo-telephone-call-icon-png-favpng-YA7gdvQCfkMxdHWDrLrU1N0vi_t.jpg"
                alt=""
            />
        </header>
    );
};

export default Header;
